import React, { Component } from 'react';
import Header from "../components/Header";
import Results from "../components/Results";


class SavedPage extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Results />
      </div>
    );
  }
}

export default SavedPage;
